"""**Standardization**: we use the formula (x - mean) / std to scale each feature so that it has a mean of 0 and a standard deviation of 1.

**Min-Max Scaling**: we use the formula (x - min) / (max - min) to scale each feature so that it has a minimum of 0 and a maximum of 1.

**Mean Normalization**: we use the formula (x - mean) / (max - min) to scale each feature so that it has a mean of 0 and a range of [-0.5, 0.5].

**Unit Vector Normalization**: we use the numpy.linalg.norm() function to calculate the Euclidean norm of each row in the DataFrame, and then divide each row by its corresponding norm to scale the values so that each row has a length of 1.

**Log Transformation**: we use the numpy.log() function to take the logarithm of each value in the DataFrame.
"""

# import numpy as np
import pandas as pd

# Generate random variables with different scales and means
x1 = np.random.normal(0, 1, size=100)  # mean=0, std=1
x2 = np.random.normal(10, 5, size=100)  # mean=10, std=5
x3 = np.random.normal(-5, 0.5, size=100)  # mean=-5, std=0.5

# Combine random variables into a DataFrame
df = pd.DataFrame({'x1': x1, 'x2': x2, 'x3': x3})

# Standardization
print("Standardization")
df_std = (df - df.mean()) / df.std()
print(df_std.head())

# Min-Max Scaling
print("Min-Max Scaling")
df_mm = (df - df.min()) / (df.max() - df.min())
print(df_mm.head())

# Mean Normalization
print("Mean Normalization")
df_mean = (df - df.mean()) / (df.max() - df.min())
print(df_mean.head())

# Unit Vector Normalization
print("Unit Vector Normalization")
df_uv = df / np.linalg.norm(df, axis=1, keepdims=True)
print(df_uv[:5])

# Log Transformation
print("Log Transformation")
df_log = np.log(df)
print(df_log.head())

"""### implement the Logistics regression technique for prediction using a sample historical univariate dataset using python."""

import matplotlib.pyplot as plt
from sklearn.model_selection import train_test_split
from math import exp
plt.rcParams["figure.figsize"] = (10, 6)

# Load the data
data = pd.read_csv("Social_Network_Ads.csv")
data.head()

# Visualizing the dataset
plt.scatter(data['Age'], data['Purchased'])
plt.show()

# Divide the data to training set and test set
X_train, X_test, y_train, y_test = train_test_split(data['Age'], data['Purchased'], test_size=0.20)

# Creating the logistic regression model

# normalize data
def normalize(X):
    return X - X.mean()

# Method to make predictions
def predict(X, b0, b1):
    return np.array([1 / (1 + exp(-1*b0 + -1*b1*x)) for x in X])

# Method to train the model
def logistic_regression(X, Y):

    X = normalize(X)

    # Initializing variables
    b0 = 0
    b1 = 0
    L = 0.001
    epochs = 300

    for epoch in range(epochs):
        y_pred = predict(X, b0, b1)
        D_b0 = -2 * sum((Y - y_pred) * y_pred * (1 - y_pred))  # Derivative of loss wrt b0
        D_b1 = -2 * sum(X * (Y - y_pred) * y_pred * (1 - y_pred))  # Derivative of loss wrt b1
        # Update b0 and b1
        b0 = b0 - L * D_b0
        b1 = b1 - L * D_b1

    return b0, b1

# Training the model
b0, b1 = logistic_regression(X_train, y_train)

# Making predictions
X_test_norm = normalize(X_test)
y_pred = predict(X_test_norm, b0, b1)
y_pred = [1 if p >= 0.5 else 0 for p in y_pred]

plt.clf()
plt.scatter(X_test, y_test)
plt.scatter(X_test, y_pred, c="red")
plt.show()

# The accuracy
accuracy = 0
for i in range(len(y_pred)):
    if y_pred[i] == y_test.iloc[i]:
        accuracy += 1
print(f"Accuracy = {accuracy / len(y_pred)}")

# Making predictions using scikit learn
from sklearn.linear_model import LogisticRegression

# Create an instance and fit the model
lr_model = LogisticRegression()
lr_model.fit(X_train.values.reshape(-1, 1), y_train.values.reshape(-1, 1))

# Making predictions
y_pred_sk = lr_model.predict(X_test.values.reshape(-1, 1))

plt.clf()
plt.scatter(X_test, y_test)
plt.scatter(X_test, y_pred_sk, c="red")
plt.show()

# Accuracy
print(f"Accuracy = {lr_model.score(X_test.values.reshape(-1, 1), y_test.values.reshape(-1, 1))}")

y_pred_sk = lr_model.predict([[67]])
y_pred_sk

"""### implement a classification problem by means of Decision Tree using Python"""

import pandas as pd

df = pd.read_csv("salaries.csv")
df.head()

inputs = df.drop('salary_more_then_100k',axis='columns')

target = df['salary_more_then_100k']

from sklearn.preprocessing import LabelEncoder
le_company = LabelEncoder()
le_job = LabelEncoder()
le_degree = LabelEncoder()

inputs['company_n'] = le_company.fit_transform(inputs['company'])
inputs['job_n'] = le_job.fit_transform(inputs['job'])
inputs['degree_n'] = le_degree.fit_transform(inputs['degree'])

inputs

inputs_n = inputs.drop(['company','job','degree'],axis='columns')

inputs_n

target

from sklearn import tree
model = tree.DecisionTreeClassifier()

model.fit(inputs_n, target)

model.score(inputs_n,target)

"""**Is salary of Google, Computer Engineer, Bachelors degree > 100 k ?**"""

model.predict([[2,1,0]])

